    t[28984] = "Distribution.ExpInfo";
    t[28985] = "<p>The exponential distribution has <b>only one parameter</b>, which defines both the expected value and the standard deviation. This has the advantage that only the expected value needs to be collected from the historical data in order to use the exponential distribution for modeling; the disadvantage, however, is that only the expected value can be set.</p>\n<p>With the exponential distribution, the standard deviation always has the same value as the expected value. This always results in a <b>coefficient of variation of 1</b>.</p>\n<p>The special property of the exponential distribution is that the probability that the event under consideration (e.g. a client arrival) will occur within the next minute is independent of whether the last event of this type occurred a minute or an hour ago. This property is also known as <b>memorylessness</b>. This usually applies to the intervals between the arrivals of independent clients. However, it practically never applies to e.g. service times.</p>\n<p>Consequently, the exponential distribution is usually very suitable for modeling <b>inter-arrival times</b>. However, other probability distributions (such as the log-normal distribution, the gamma distribution or the triangular distribution) should be used for modeling service times and similar variables.</p>";
