    t[45032] = "Distribution.TriangularInfo";
    t[45033] = "<p>The triangular distribution is always used when <b>expected value and standard deviation cannot be collected</b>, i.e. when no evaluable historical data is available. With the triangular distribution, the smallest value that has ever occurred (minimum), the most frequently occurring value (mode) and the largest value that has ever occurred (maximum) has to be set instead.</p>\n<p>This procedure, which differs greatly from the usual parameterization of many distributions, makes the triangular distribution interesting for cases in which no historical data is available from which the expected value and standard deviation can be determined.</p>\n<p>The problem with querying the parameters is that the <b>mode</b>, i.e. the value at which the probability density is highest, has to be specified. This usually does not match the mean value of the data.</p>";
